import "./App.scss";
import Slide from "./components/Slide";
import axios from "./api/axios";
import { useEffect } from "react";
import request from "./api/Api";
function App() {
  useEffect(() => {
    axios.get(request.fetchtoprated).then((dat) => {
      console.log(dat);
    });
  }, []);
  return (
    <div className='App'>
      <Slide />
    </div>
  );
}

export default App;
